					var gas = false;
					var count = new sjs.Text("",500,"red");
					var count2 = new sjs.Text("",500,"red");
					var count3 = new sjs.Text("",500,"red");
					var go = new sjs.Text("",500,"red");

					setTimeout(function(){
						count.setText("3");
						count.moveTo(400,1900);
						setTimeout(function(){
							count.destroy();
							count2.setText("2");
							count2.moveTo(400,1900);
						},1000);

						setTimeout(function(){
							count2.destroy();
							count3.setText("1");
							count3.moveTo(400,1900);
						},2000);

						setTimeout(function(){
							count3.destroy();
							go.setText("GO!");
							go.moveTo(0,1900);
						},3000);

						setTimeout(function(){
							go.destroy();
							gas = true;
						},4000);
					},500);

					var time = 0;
					var left = 25;
					var fin = false;

					var timer = new sjs.Text("Time: ",30,"white");
					timer.moveTo(0,1900);

					var timer2 = new sjs.Text("Time: ",30,"white");
					timer2.center().offset(0,-150);

					var timer3 = new sjs.Text("Time: ",30,"white");
					timer3.moveTo(3000,2000);

					setTimeout(function(){
						var active = setInterval(function(){
							time ++;
							timer.setText("Time: "+time);
							timer2.setText("Time: "+time);
							timer3.setText("Time: "+time);
							left --;
							if(left == 0){
								clearInterval(active);
								window.location = "lose.html";
							}
							if(fin == true){
								clearInterval(active);
							}
						},1000);
					},4700);

					var car = new sjs.Image("Images/car.png");
					car.type = "car";
					car.setSize(70,80);
					car.center().offset(0,2000);
					car.friction = 0.1;
					car.noBounds = true;
					car.setGravity(1);

					sjs.scrollable(car,background);

					sjs.keyDown(UP_KEY,function(){
						if(gas == true){
							car.pushUp(2);
							car.setGravity(0);
							car.setImage("Images/car.png");
						}
					});

					sjs.keyDown(DOWN_KEY,function(){
						if(gas == true){
							car.pushDown(2);
							car.setImage("Images/car_d.png");
						}
					});

					sjs.keyDown(RIGHT_KEY,function(){
						if(gas == true){
							car.pushRight(2);
							car.setImage("Images/car_r.png");
						}					
					});

					sjs.keyDown(LEFT_KEY,function(){
						if(gas == true){
							car.pushLeft(2);
							car.setImage("Images/car_l.png");
						}
					});

					sjs.onHit("car","bottom_screen",function(x,y){
						sjs.stoppedBy(x,y);
					});

					sjs.onHit("car","top_screen",function(x,y){
						sjs.stoppedBy(x,y);
					});

					sjs.onHit("car","border",function(x,y){
						sjs.stoppedBy(x,y);
					});

					sjs.onHit(["white","black"],"border",function(x,y){
						y.destroy();
					});

					sjs.onHit("car",["white","black"],function(x,y){
						if(x.isLeftOf(y)){
							sjs.stoppedBy(x,y);
						}
						if(x.isRightOf(y)){
							var finished = new sjs.Text("FINISH",300,"red");
							finished.moveTo(0,1900);
							fin = true;

							},3000);
						}
					});
